// let's go!
alert('hey');
import React, { Component } from 'react';

class StatefulComponent extends React.Component {
    constructor(props) {
      super(props);
      // initialize state here
      this.state = {
        name: "erwin"
      }
    }
    render() {
      return (
        <div>
          <h1>{this.state.name}</h1>
        </div>
      );
    }
  };

  ReactDOM.render(StatefulComponent, document.getElementById('main'));
